import React, {  useState } from 'react';

import './App.css';
function App() {
  const [file, setFile]= useState(null);

  return (
    <div className='App'>
      <h1>File Upload </h1>
    <input onChange={ (e) => {setFile(e.target.files[0]) } } type ="file"/>
    <button>Upload</button>

    </div>
  );
}

export default App;
